import Fab from '@mui/material/Fab';

function Button(props) {

    return (
        <Fab
            variant={props.variant || "extended"}
            href={props.href}
            sx={{
                fontFamily: "Abel",
                fontSize: "16px",
                margin: "32px auto",
                display: "flex",
                width: props.width || "0.20",
                minWidth: "250px",
                color: props.color || "#F0EAD6",
                backgroundColor: props.backgroundColor || "#1d2951",
                '&:hover': {
                    color: props.hoverColor || '#000',
                    backgroundColor: props.hoverBackgroundColor || "#ececec"
                },
            }}
            >
                {props.linkIcon}{props.linkText}
            </Fab>
    );
}

export default Button;
